import { Header } from '../Components/Header';
import { Footer } from '../Components/Footer';
import '../style/main.css';
export function Home () {
    return (
        <div className="main-wrapper">
            <Header/>
            <br></br>
            <h1>Hello!
                <br></br>This is Utkarsh Singh,
                <br></br>I am an <strong>Aspiring Software Developer</strong>
            </h1>
            <br></br>
            <p>Currently pursuing a Bachelor of Computer Applications (BCA), with a strong foundation in software development, data structures, operating systems, and database management. Proficient in Core Java, JSP, HTML, CSS, JavaScript, and frameworks like Spring MVC. Experienced in Oracle SQL for database-driven applications. Familiar with computer networking and system architecture. Passionate about problem-solving, web development, and writing efficient code. Constantly learning and working on real-world projects to enhance my technical skills. Open to opportunities in software development and IT.</p>
            <Footer/>
        </div>
    )
}
